import {createContext, useState} from "react";
import React from 'react';


export const HightContext = createContext();

const HightProvider = ({children}) => {

    const [hight, setHight] = useState(0);

    return (
        <HightContext.Provider value={[hight, setHight]}>
            {children}
        </HightContext.Provider>
    );
};
export default HightProvider;
